import Radiobtns from './radiobtnhtml/Radiobtnhtml'

class Radiobtn extends Component {
    render() {
        return (
            <>
                <div className="col-md-3">
                    <Radiobtns id="switch" label="Enabled" />
                </div>
            </>
        );
    }
}

export default Radiobtn;
